import React, { useEffect, useRef, useState } from "react";
import { Link } from "react-router-dom";
import "../../styles/EmployeeOwnership.css";

function EmployeeOwnership() {
  const featureRefs = useRef([]);
  const heroRef = useRef(null);
  const ctaRef = useRef(null);

  /* HERO SLIDESHOW */
  const heroImages = [
    "/images/gallery3.jpg",
    "/images/gallery5.jpg",
    "/images/gallery7.jpg",
    "/images/gallery9.jpg",
    "/images/gallery11.jpg",
    "/images/gallery13.jpg",
    "/images/gallery15.jpg",
    "/images/gallery18.jpg",
  ];
  const [heroIndex, setHeroIndex] = useState(0);

  useEffect(() => {
    const heroInterval = setInterval(() => {
      setHeroIndex((prev) => (prev + 1) % heroImages.length);
    }, 4500);
    return () => clearInterval(heroInterval);
  }, []);

  /* SCROLL ANIMATIONS */
  useEffect(() => {
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry, index) => {
          if (entry.isIntersecting) {
            entry.target.style.transitionDelay = `${index * 0.15}s`;
            entry.target.classList.add("animate-in");
          }
        });
      },
      { threshold: 0.15 }
    );

    featureRefs.current.forEach((el) => el && observer.observe(el));
    if (heroRef.current) observer.observe(heroRef.current);
    if (ctaRef.current) observer.observe(ctaRef.current);

    return () => observer.disconnect();
  }, []);

  const setRefs = (el, index) => {
    featureRefs.current[index] = el;
  };

  return (
    <div className="eo-container">

      {/* HERO SECTION */}
      <section className="eo-hero fade-slide" ref={heroRef}>
        <div
          className="eo-hero-bg"
          style={{ backgroundImage: `url(${heroImages[heroIndex]})` }}
        />
        <div className="eo-hero-overlay" />

        <div className="eo-hero-content">
          <h1>Employee Ownership at RGM Logistics</h1>
          <p>More Than a Company. A Family That Builds the Future Together.</p>
        </div>
      </section>

      {/* INTRO */}
      <section className="eo-intro fade-slide">
        <p>
          At <strong>RGM Logistics</strong>, employee ownership is a belief, not a buzzword.
          We grow together, succeed together, and protect what we build together.
        </p>
      </section>

      {/* MAIN CONTENT */}
      <section className="eo-sections">

        <div className="eo-section">
          <h2>What Employee Ownership Means to Us</h2>
          <p>
            It means shared responsibility, shared pride, and shared success.
            Every employee contributes to something bigger than a job.
          </p>
        </div>

        {/* IMAGE STRIP */}
        <div className="eo-image-strip">
          <img src="/images/gallery12.jpg" alt="" />
          <img src="/images/gallery14.jpg" alt="" />
          <img src="/images/gallery16.jpg" alt="" />
        </div>

        <div className="eo-feature" ref={(el) => setRefs(el, 0)}>
          <h3>ðŸ”’ Stability & Job Security</h3>
          <p>We grow long-term relationships, not short-term profits.</p>
        </div>

        <div className="eo-feature" ref={(el) => setRefs(el, 1)}>
          <h3>ðŸ¤œðŸ¤› One Team, One Vision</h3>
          <p>Collaboration drives progress, trust builds success.</p>
        </div>

        <div className="eo-feature" ref={(el) => setRefs(el, 2)}>
          <h3>ðŸ’° Growth Beyond a Paycheck</h3>
          <p>Professional growth, leadership paths, and shared rewards.</p>
        </div>

        <div className="eo-feature" ref={(el) => setRefs(el, 3)}>
          <h3>ðŸš€ Long-Term Opportunity</h3>
          <p>As RGM expands, our people rise with it.</p>
        </div>

      </section>

      {/* CTA */}
      <section className="eo-cta fade-slide" ref={ctaRef}>
        <h2>The RGM Promise</h2>
        <p>
          Join a company where loyalty, respect, and growth are non-negotiable.
        </p>
        <Link to="/join/apply" className="eo-apply-btn">
          Join the RGM Family
        </Link>
      </section>

    </div>
  );
}

export default EmployeeOwnership;
